import React, { Component } from 'react';
import axios from 'axios';
import { Button, Card, CardBody, CardHeader, Table } from 'reactstrap';
import { Sidebar, InputItem, DropdownItem, Icon, Item, Logo, LogoText } from 'react-sidebar-ui'

const url = (process.env.REACT_APP_DOMAIN) + ':' + (process.env.REACT_APP_PORT) + '/';

class TestsPage extends Component {
  constructor(props) {
    super(props);
    this.state = {
      tests: [{
        "title": "test",
        "professor_id": "1",
        "max_score": "2",
        "questions": [
          {
            "title": "Ko je lenjivac",
            "points": "1",
            "answers": [
              {
                "title": "Zec",
                "isCorrect": 0
              },
              {
                "title": "Zmija",
                "isCorrect": 1
              },
              {
                "title": "Guster",
                "isCorrect": 1
              }
            ]
          },
          {
            "title": "Ko je nesto drugo",
            "points": "1",
            "answers": [
              {
                "title": "Zec",
                "isCorrect": 0
              },
              {
                "title": "Orao",
                "isCorrect": 1
              },
              {
                "title": "Vrabac",
                "isCorrect": 1
              }
            ]
          }
        ]
      },
      {
        "title": "Drugi test",
        "professor_id": "1",
        "max_score": "3",
        "questions": [
          {
            "title": "Pitanje 1",
            "points": "1",
            "answers": [
              {
                "title": "Odgovor1",
                "isCorrect": 0
              },
              {
                "title": "ODgvor 2",
                "isCorrect": 1
              },
              {
                "title": "Odgovor 2",
                "isCorrect": 1
              }
            ]
          },
          {
            "title": "Pitanje 2",
            "points": "2",
            "answers": [
              {
                "title": "Odgovor 21",
                "isCorrect": 0
              },
              {
                "title": "Odgovor2-2",
                "isCorrect": 1
              },
              {
                "title": "Odgovor 3-3",
                "isCorrect": 1
              }
            ]
          }
        ]
      }
      ]
    };

    this.getTests = this.getTests.bind(this);

  }

  componentDidMount() {
    //this.getTests()
  }

  getTests() {
    axios({
      method: 'get',
      url: url + 'test',
    }).then((response) => {
      console.log(response);
      this.setState({ tests: response.data })
    }, (error) => {
      console.log(error);
    });
  }


  render() {
    return (
      <div>
      {(this.state.tests).map((test, index) =>

       <Row hidden={this.state.hideSearch}>
          <Col xs="12" md="12" sm="12">
            <Card>
              <CardHeader>
                <Button block color="link" className="text-center m-0 p-0" onClick={() => this.toggleAccordion(0)} aria-expanded={this.state.accordion[0]} aria-controls="collapseOne">
                  <h5 className="m-0 p-0">Start your search here</h5>
                </Button>              </CardHeader>
              <Collapse isOpen={this.state.accordion[0]} data-parent="#accordion" id="collapseOne" aria-labelledby="headingOne">
                <CardBody>
                  <Row>
                    <Col md="3" xs="3" sm="3">
                      <FormGroup>
                        <Label>Pick up date</Label>
                        <InputGroup>
                          <InputGroupAddon addonType="prepend">
                            <InputGroupText>
                              <i className="fa fa-calendar"></i>
                            </InputGroupText>
                          </InputGroupAddon>
                          <Input type="date" name="startDate" onChange={(e) => this.startDateValidation(e.target.value)} placeholder="Pick up date" />
                        </InputGroup>
                        <FormText color="danger">{this.state.startDateError}</FormText>
                      </FormGroup>
                    </Col>
                    <Col md="3" xs="3" sm="3">
                      <FormGroup>
                        <Label>Pick up time</Label>
                        <InputGroup>
                          <InputGroupAddon addonType="prepend">
                            <InputGroupText>
                              <i className="fa fa-clock-o"></i>
                            </InputGroupText>
                          </InputGroupAddon>
                          <Input type="time" name="startTime" onChange={(e) => this.startTimeValidation(e.target.value)} placeholder="Pick up time" />
                        </InputGroup>
                        <FormText color="danger">{this.state.startTimeError}</FormText>
                      </FormGroup>
                    </Col>
                    <Col md="3" xs="3" sm="3">
                      <FormGroup>
                        <Label>Drop off date</Label>
                        <InputGroup>
                          <InputGroupAddon addonType="prepend">
                            <InputGroupText>
